  \"Cooperative Recovery Initiative: Bull Trout Restoration: Restoring Cold, Clean,
  Complex and Connected Habitat in the Blackfoot River Watershed of Montana Interim
  Report\",\n\t\"tracking_summary\": {\n\t\t\"total\": 0,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-08-31T11:26:10.614966\",\n\t\"name\":
  \"cooperative-recovery-initiative-bull-trout-restoration-restoring-cold-clean-complex-and-co-8a33c\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Habitat degradation and the effects of
  climate change are the biggest threats to bull trout in the Blackfoot River watershed
  of Montana.  Montana Fish, Wildlife & Parks have determined that 90% of all tributaries
  to the Blackfoot River have extensive habitat degradation that is affecting bull
  trout populations.  The 2015 Bull Trout Recovery Plan identified the Blackfoot River
  Watershed as one of the highest priority landscapes to ameliorate the identified
  threats of climate change.  This project will restore the four Cu2019s (Cold, Clean,
  Complex and Connected Habitat) for bull trout and other native salmonids within
  the Blackfoot Valley Conservation Area (Conservation Easement Refuge).\",\n\t\"license_title\":
